def getMatchIDs():
    matchIDsByMMR = {}

    avg_mmr = 0
    while avg_mmr < 6001:
        print(avg_mmr)

        #template = 'select * from public_matches join public_player_matches using(match_id) where avg_mmr > {lowerLimit} and avg_mmr < {upperLimit} and hero_id = 82 limit 100;'
        #template = 'select * from public_matches join public_player_matches using(match_id) where avg_mmr > {lowerLimit} and avg_mmr < {upperLimit} limit 100;'
        template = 'select * from public_matches where avg_mmr > {lowerLimit} and avg_mmr < {upperLimit} limit 150;'
        query = template.format(lowerLimit=avg_mmr, upperLimit=avg_mmr+500)
        res = odexplorer.ODExplorer(query)

        duration = 0

        matchIDs = []
        for row in res['rows']:
            matchIDs.append(row['match_id'])
            duration += row['duration']

        duration /= len(matchIDs)
        duration = int(duration)
        print(timeconverter.durationTimeConverter(duration))

        matchIDsByMMR[avg_mmr] = matchIDs
        avg_mmr += 500

    return matchIDsByMMR


